/**
 * A Property String is an arbitrary string value to display to the user
 */
export class PropertyString {
    data;
    constructor(data) {
        this.data = data;
    }
    /**
     * Returns a new Property String with the provided options
     * @param value
     * @returns
     */
    static of(value) {
        return new PropertyString({
            ...value,
            type: "string",
        });
    }
}
